 	my_name coworking.cw_name%TYPE;
 	my_description coworking.cw_description%TYPE;
	my_capacity coworking.cw_capacity%TYPE;
	my_daily_price coworking.cw_daily_price%TYPE;
	my_lat coworking.cw_lat%TYPE;
	my_lon coworking.cw_lon%TYPE;
	my_cw_image coworking.cw_image%TYPE;
	my_cw_image_resized coworking.cw_image_resized%TYPE;

	my_location coworking.cw_location%TYPE;

	my_cw_id coworking.cw_id%TYPE;

	my_date	TIMESTAMP;

