	/*	Asignamos la fecha de partida de los datos actuales	*/
	SELECT CURRENT_DATE - INTERVAL '1 month' INTO my_date;

/*
**
**      Creamos corworking Buen Camino
**
*/

	/*	Asignamos los valores del coworking que vamos a crear	*/
	SELECT 'Arzúa','Rua de Ramon Franco, 39', 'Buen Camino', 'Noche incluida en el precio.' INTO my_city, my_address, my_name, my_description;

	/*	Recuperamos el código de ciudad para que recupere el valor de la ciudad	*/
  	SELECT id_city INTO my_location FROM city where city =  my_city;

	SELECT 10, 15, 42.9304551433853, -8.16299703242097 INTO my_capacity, my_daily_price, my_lat, my_lon coworking;
	SELECT ''
	INTO my_cw_image;

	SELECT ''
	INTO my_cw_image_resized;

	/*	Recuperamos el código de ciudad para que recupere el valor de la ciudad	*/
	SELECT id_city INTO my_location FROM city where city =  my_city;

	/*	Recuperamos el código de usuario para que genere los coworking	*/
	SELECT usr_ID INTO company_user_id FROM usr_user WHERE usr_login = 'company';

	/*	Insertamos un nuevo coworking*/
	INSERT INTO public.coworking (cw_id, cw_name, cw_description, cw_address, cw_capacity, cw_daily_price, cw_usr_id, cw_start_date, cw_end_date, cw_image, cw_location, cw_lat, cw_lon, cw_image_resized)
	values (nextval('coworking_cw_id_seq'::regclass), my_name, my_description, my_address, my_capacity, my_daily_price, company_user_id, my_date, null, my_cw_image, my_location, my_lat, my_lon, my_cw_image_resized)
	RETURNING cw_id INTO my_cw_id;

	/*	Insertamos los servicios del nuevo coworking: 1.- additional_screen | 2.- vending_machine | 3.- coffee_bar | 4.- water_dispenser | 5.- ergonomic_chair | 6.- parking */
	INSERT INTO public.cw_service (cser_id, cw_id, srv_id) VALUES(nextval('cw_service_cser_id_seq'::regclass), my_cw_id, 1);
